<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE nmaprun>
<nmaprun unknown="attrib">
  <scaninfo unknown="attrib" />
  <verbose unknown="attrib" />
  <debugging unknown="attrib" />

  <host unknown="attrib">
    <address unknown="attrib" />

    <hostnames unknown="attrib">
      <hostname unknown="attrib" />
    </hostnames>

    <ports unknown="attrib">
      <extraports unknown="attrib">
        <extrareasons unknown="attrib" />
      </extraports>

      <port unknown="attrib">
        <state unknown="attrib" />

        <service unknown="attrib">
          <cpe unknown="attrib">
            mock
           </cpe>
        </service>

        <script unknown="attrib">
          <table unknown="attrib">
            <elem unknown="attrib">mock</elem>
          </table>
        </script>
      </port>
      <port protocol="tcp" portid="80">
        <state unknown="attrib" />
        <service unknown="attrib">
          <cpe unknown="attrib">
            mock
          </cpe>
        </service>
        <script unknown="attrib">
          <elem unknown="attrib">
            mock
          </elem>
        </script>
        <script unknown="attrib">
          <elem unknown="attrib">
            mock
          </elem>
        </script>
      </port>
      <port unknown="attrib">
        <state unknown="attrib" />
        <service unknown="attrib" />
      </port>
    </ports>
    <os unknown="attrib">
      <portused unknown="attrib" />
      <osmatch  unknown="attrib">
        <osclass  unknown="attrib">
          <cpe unknown="attrib">mock</cpe>
        </osclass>
      </osmatch>
    </os>
    <uptime unknown="attrib" />
    <distance unknown="attrib" />
    <tcpsequence unknown="attrib" />
    <ipidsequence unknown="attrib" />
    <tcptssequence unknown="attrib" />
    <trace unknown="attrib">
      <hop unknown="attrib" />
    </trace>
    <times unknown="attrib" />
  </host>

  <runstats unknown="attrib">
    <finished unknown="attrib" />
    <hosts unknown="attrib" />
  </runstats>
</nmaprun>
